      body: "Helm v3.9.3 is a patch release. Users are encouraged to upgrade for the
        best experience. Users are encouraged to upgrade for the best experience.\r\n\r\nThe
        community keeps growing, and we'd love to see you there!\r\n\r\n- Join the
        discussion in [Kubernetes Slack](https://kubernetes.slack.com):\r\n  -  for
        questions and just to hang out\r\n  -  for discussing PRs, code, and bugs\r\n-
        Hang out at the Public Developer Call: Thursday, 9:30 Pacific via [Zoom](https://zoom.us/j/696660622)\r\n-
        Test, debug, and contribute charts: [ArtifactHub/packages](https://artifacthub.io/packages/search?kind=0)\r\n\r\n##
        Installation and Upgrading\r\n\r\nDownload Helm v3.9.3. The common platform
        binaries are here:\r\n\r\n- [MacOS amd64](https://get.helm.sh/helm-v3.9.3-darwin-amd64.tar.gz)
        ([checksum](https://get.helm.sh/helm-v3.9.3-darwin-amd64.tar.gz.sha256sum)
        / ca3d57bb68135fa45a7acc2612d472e8ad01b78f49eaca57490aefef74a61c95)\r\n- [MacOS
        arm64](https://get.helm.sh/helm-v3.9.3-darwin-arm64.tar.gz) ([checksum](https://get.helm.sh/helm-v3.9.3-darwin-arm64.tar.gz.sha256sum)
        / db20ee8758616e1d69e90aedc5eb940751888bdd2b031badf2080a05df4c9eb7)\r\n- [Linux
        amd64](https://get.helm.sh/helm-v3.9.3-linux-amd64.tar.gz) ([checksum](https://get.helm.sh/helm-v3.9.3-linux-amd64.tar.gz.sha256sum)
        / 2d07360a9d93b18488f1ddb9de818b92ba738acbec6e1c66885a88703fa7b21c)\r\n- [Linux
        arm](https://get.helm.sh/helm-v3.9.3-linux-arm.tar.gz) ([checksum](https://get.helm.sh/helm-v3.9.3-linux-arm.tar.gz.sha256sum)
        / 2b8cdb8064914ed1f1cd17f8366e68eab2f14e9fb0b2a0bac0f47fac7fbddf36)\r\n- [Linux
        arm64](https://get.helm.sh/helm-v3.9.3-linux-arm64.tar.gz) ([checksum](https://get.helm.sh/helm-v3.9.3-linux-arm64.tar.gz.sha256sum)
        / 59168c08c32293759005d0c509ce4be9038d7663827e05564c779e59658d8299)\r\n- [Linux
        i386](https://get.helm.sh/helm-v3.9.3-linux-386.tar.gz) ([checksum](https://get.helm.sh/helm-v3.9.3-linux-386.tar.gz.sha256sum)
        / 634a5dca59674cb77fb7a69d08cee00c9051505e81af1c1d3ea96e5f3de84dbc)\r\n- [Linux
        ppc64le](https://get.helm.sh/helm-v3.9.3-linux-ppc64le.tar.gz) ([checksum](https://get.helm.sh/helm-v3.9.3-linux-ppc64le.tar.gz.sha256sum)
        / bf06f00a01e01a3ad011c0b70fbbb07db3e65f2134ed5e640a2a2832a4101f48)\r\n- [Linux
        s390x](https://get.helm.sh/helm-v3.9.3-linux-s390x.tar.gz) ([checksum](https://get.helm.sh/helm-v3.9.3-linux-s390x.tar.gz.sha256sum)
        / 257a7373b380dc1fdb811030867c1483c511a5521bb1348fe59e97883582f9f3)\r\n- [Windows
        amd64](https://get.helm.sh/helm-v3.9.3-windows-amd64.zip) ([checksum](https://get.helm.sh/helm-v3.9.3-windows-amd64.zip.sha256sum)
        / cdd24727d233e620ce6e8ec21646a6218bde94cf3d5f24e9c4ae6a114939975d)\r\n\r\nThis
        release was signed with `672C 657B E06B 4B30 969C 4A57 4614 49C2 5E36 B98E
        ` and can be found at @mattfarina [keybase account](https://keybase.io/mattfarina).
        Please use the attached signatures for verifying this release using `gpg`.\r\n\r\nThe
        [Quickstart Guide](https://helm.sh/docs/intro/quickstart/) will get you going
        from there. For **upgrade instructions** or detailed installation notes, check
        the [install guide](https://helm.sh/docs/intro/install/). You can also use
        a [script to install](https://raw.githubusercontent.com/helm/helm/main/scripts/get-helm-3)
        on any system with `bash`.\r\n\r\n## What's Next\r\n\r\n- 3.10.0 is the next
        feature release and will be on September 13, 2022\r\n\r\n## Changelog\r\n\r\n-
        Bump k8s.io/kube-openapi to fix CVE-2022-1996 in github.com/emicklei/go-restful
        414ff28d4029ae8c8b05d62aa06c7fe3dee2bc58 (Guilherme Macedo)\r\n- fixes #11142
        missing array length check on release c801d8876a6fc9c9a5bfa15f31892e16cd30c7bd
        (Arvid E. Picciani)\r\n"
